import React from "react";
import { Button } from 'react-bootstrap';
import { nonoTest } from '../../APIs/AdminPanelApis';

function Test2() {

    const testHandler = () => {
        nonoTest(1).then((mahmoud) => {
            console.log(mahmoud);
        });
    }

    return (
        <div>
            <Button onClick={testHandler} variant="outline-success">test</Button>
        </div>
    )
}

export default Test2;
